INSERT INTO `course` VALUES (1,'&ecirc;wdewd','kien truc1','2222','2019-27-29 06:27:08',_binary '','41',200000,1),(2,'&ecirc;fefe','phan mem1','cnpm1','2019-21-29 08:21:15',_binary '','231',200000,112),(3,'<h3>LED c&ocirc;ng nghệ chiếu s&aacute;ng ti&ecirc;n tiến v&agrave; vượt trội</h3>\r\n\r\n<p>DenLEDNhat.Com &ndash; LED&nbsp;đ&atilde; v&agrave; đang được ứng dụng phong ph&uacute; từ c&ocirc;ng nghệ &aacute;nh s&aacute;ng điốt ph&aacute;t quang (LED) thế hệ mới trong thực tiễn sinh hoạt v&agrave; l&agrave;m việc. C&aacute;c nh&agrave; sản xuất&nbsp;đ&atilde; ph&aacute;t triển c&aacute;c t&iacute;nh năng mới cho thiết bị sử dụng &aacute;nh s&aacute;ng LED, một c&ocirc;ng nghệ ti&ecirc;n tiến c&oacute; nhiều ưu điểm về mặt thẩm mĩ v&agrave; th&acirc;n thiện với m&ocirc;i trường.</p>\r\n\r\n<p>C&ocirc;ng nghệ đ&egrave;n LED kh&ocirc;ng chỉ tiết kiệm điện năng m&agrave; c&ograve;n dễ d&agrave;ng lắp đặt v&agrave;o c&aacute;c thiết kế d&ugrave;ng cho chiếu s&aacute;ng c&ocirc;ng sở, quảng c&aacute;o sản phẩm, tr&igrave;nh diễn nghệ thuật, chiếu s&aacute;ng tại c&aacute;c cửa hiệu, nh&agrave; h&agrave;ng, tiệm thời trang hay tại c&aacute;c gia đ&igrave;nh với nguồn &aacute;nh s&aacute;ng đ&aacute;p ứng tốt mọi &yacute; đồ của người sử dụng.</p>\r\n\r\n<p><em>Một g&oacute;c của nh&agrave; m&aacute;y sản xuất chiếu s&aacute;ng Nhật bản</em></p>\r\n\r\n<p>Hiện khoảng 1/4 lượng điện ti&ecirc;u thụ tr&ecirc;n thế giới được sử dụng cho mục đ&iacute;ch chiếu s&aacute;ng. Đ&egrave;n LED g&oacute;p phần tiết kiệm nguồn t&agrave;i nguy&ecirc;n của tr&aacute;i đất với độ bền tới 100.000 giờ, trong khi b&oacute;ng đ&egrave;n sợi đốt chỉ l&agrave; 1.000 giờ v&agrave; b&oacute;ng đ&egrave;n huỳnh quang l&agrave; 10.000 giờ. Đ&egrave;n LED hứa hẹn sẽ tăng chất lượng cuộc sống cho hơn 1,5 tỉ người ngh&egrave;o tr&ecirc;n thế giới đang kh&ocirc;ng được tiếp cận với điện.</p>\r\n\r\n<h3>Ứng dụng của đ&egrave;n LED</h3>\r\n\r\n<p>C&ocirc;ng nghệ chiếu s&aacute;ng LED đang được c&aacute;c nh&agrave; sản xuất triển khai tại thị trường Nhật Bản v&agrave; c&aacute;c tập đo&agrave;n n&agrave;y đang hướng đến c&aacute;c thị trường tiềm năng kh&aacute;c tr&ecirc;n thế giới, trong đ&oacute; c&oacute; Việt Nam, đặc biệt l&agrave; ph&acirc;n kh&uacute;c thị trường chiếu s&aacute;ng gia đ&igrave;nh.</p>\r\n\r\n<p>&ldquo;&Aacute;nh s&aacute;ng LED c&oacute; nhiều t&iacute;nh năng vượt trội kh&ocirc;ng chỉ tiết kiệm điện năng, th&acirc;n thiện với m&ocirc;i trường m&agrave; c&ograve;n l&agrave; loại &aacute;nh s&aacute;ng được điều chỉnh kh&aacute; linh hoạt về m&agrave;u sắc hay chất lượng &aacute;nh s&aacute;ng tùy theo nhu cầu sử dụng. Với những ưu điểm như vậy, ch&uacute;ng t&ocirc;i muốn đẩy mạnh triển khai c&aacute;c sản phẩm LED phục vụ nhu cầu trong cuộc sống thường nhật.&rdquo; Một chuy&ecirc;n gia chiếu s&aacute;ng Nhật bản cho biết.</p>\r\n\r\n<h3>Đặc t&iacute;nh của đ&egrave;n LED</h3>\r\n\r\n<p>Nhờ cấu tạo gọn nhẹ, &aacute;nh s&aacute;ng LED c&oacute; thể thay đổi được h&igrave;nh d&aacute;ng v&agrave; k&iacute;ch thước tùy theo nhu cầu đa dạng trong sinh hoạt. C&aacute;c sản phẩm đ&egrave;n LED c&oacute; thể dưới dạng h&igrave;nh cầu, h&igrave;nh chữ nhật, h&igrave;nh trụ, tam gi&aacute;c hay lục lăng,&hellip; lắp đặt được ở hầu hết c&aacute;c kết cấu kiến tr&uacute;c phức tạp, đ&aacute;p ứng đầy đủ c&aacute;c y&ecirc;u cầu về mặt thẩm mỹ v&agrave; thiết kế nội thất.</p>\r\n\r\n<p>Ngo&agrave;i ra, cường độ &aacute;nh s&aacute;ng, chất lượng v&agrave; m&agrave;u sắc của &aacute;nh s&aacute;ng c&oacute; thể thay đổi ngay trong một thiết bị chiếu s&aacute;ng chỉ với những n&uacute;t điều khiển đơn giản, điều m&agrave; kh&ocirc;ng một thiết bị chiếu s&aacute;ng n&agrave;o trước đ&acirc;y c&oacute; thể l&agrave;m được. Hiện nay, c&aacute;c thiết bị chiếu s&aacute;ng LED ti&ecirc;n tiến nhất d&ugrave;ng cho gia đ&igrave;nh đ&atilde; được rao b&aacute;n tại Nhật Bản từ th&aacute;ng 4/2015.</p>\r\n\r\n<p>Đ&egrave;n LED thường c&oacute; mức đầu tư ban đầu cao hơn so với c&aacute;c loại b&oacute;ng đ&egrave;n kh&aacute;c. Tuy nhi&ecirc;n, gi&aacute; của n&oacute; li&ecirc;n tục được giảm theo thời gian v&agrave; dự kiến xuống mức được &aacute;p dụng rộng r&atilde;i ở c&aacute;c nước ngh&egrave;o. Việc sử dụng đ&egrave;n bằng b&oacute;ng LED c&oacute; thể cải thiện chất lượng cuộc sống của họ.</p>\r\n\r\n<p>Bằng c&aacute;ch sử dụng đ&egrave;n LED, ảnh hưởng từ c&aacute;c nguồn chiếu s&aacute;ng g&acirc;y &ocirc; nhiễm c&oacute; thể được hạn chế. Do y&ecirc;u cầu c&ocirc;ng suất thấp, đ&egrave;n LED c&oacute; thể được hỗ trợ nhờ điện năng lượng mặt trời gi&aacute; rẻ. Trong tương lai, nếu chi ph&iacute; sử dụng ng&agrave;y c&agrave;ng rẻ hơn, ch&uacute;ng c&oacute; thể thay thế c&aacute;c loại đ&egrave;n huỳnh quang hay đ&egrave;n sợi đốt vốn được sử dụng phổ biến ở ch&acirc;u &Acirc;u hay Mỹ.</p>\r\n\r\n<h3>Đ&egrave;n LED Việt Nam</h3>\r\n\r\n<p>Tại Việt Nam, rất nhiều gia đ&igrave;nh đ&atilde; bắt đầu đưa C&ocirc;ng nghệ chiếu s&aacute;ng LED v&agrave;o sử dụng, dần thay thế cho b&oacute;ng đ&egrave;n huỳnh quang. Tuy nhi&ecirc;n, LED thường c&oacute; mức đầu tư ban đầu lớn hơn so với 1 v&agrave;i mẫu b&oacute;ng đ&egrave;n kh&aacute;c, vậy n&ecirc;n c&aacute;c doanh nghiệp, đặc biệt l&agrave; một v&agrave;i doanh nghiệp c&oacute; nh&agrave; m&aacute;y vẫn c&ograve;n kh&aacute; e ngại d&ugrave;ng C&ocirc;ng nghệ chiếu s&aacute;ng LED. Tuy vậy nhưng, gi&aacute; của Đ&egrave;n LED hiện đang được giảm li&ecirc;n tục theo thời gian v&agrave; dự kiến sẽ xuống được tới mức c&oacute; thể &aacute;p dụng rộng khắp ở một số nước ngh&egrave;o.</p>\r\n\r\n<p>Về ph&iacute;a người ti&ecirc;u sử dụng, kh&ocirc;ng &iacute;t gia đ&igrave;nh mua phải h&agrave;ng c&oacute; nguồn gốc kh&ocirc;ng r&otilde; r&agrave;ng cụ thể, chất lượng kh&ocirc;ng tốt dẫn tới vấn đề thiếu niềm tin v&agrave; đ&aacute;nh đồng chất lượng của đ&egrave;n LED k&eacute;m chất lượng với đ&egrave;n LED chất lượng cao cấp cho việc đầu tư v&agrave;o LED.</p>\r\n\r\n<p>Với hiệu quả mang t&iacute;nh vượt trội so với c&aacute;c c&ocirc;ng nghệ chiếu s&aacute;ng th&ocirc;ng thường, &aacute;nh s&aacute;ng LED đang tạo ra một cuộc c&aacute;ch mạng trong lĩnh vực chiếu s&aacute;ng tr&ecirc;n quy m&ocirc; to&agrave;n cầu. Theo đ&aacute;nh gi&aacute; của c&aacute;c chuy&ecirc;n gia trong lĩnh vực chiếu s&aacute;ng, trong tương lai kh&ocirc;ng xa, &aacute;nh s&aacute;ng LED được coi như l&agrave; một lựa chọn h&agrave;ng đầu cho c&aacute;c giải ph&aacute;p chiếu s&aacute;ng tại c&aacute;c gia đ&igrave;nh, trong đ&oacute; c&oacute; Việt Nam./.</p>\r\n','Công nghệ và ứng dụng LED tiên tiến','LED.1001001','2019-22-02 09:22:15',_binary '','3 Tuần',200000,126);
